import React from 'react';

export default function About() {
  return (
    <section className="container mx-auto p-4">
      <h2 className="text-2xl font-bold mb-4">About Us</h2>
      <p>
        My Restaurant has been serving delicious meals since 2025. We pride ourselves
        on fresh ingredients, friendly staff, and a cozy atmosphere.
      </p>
    </section>
  );
}
